import React from 'react';
import YandexMap from "../../Map/YandexMap";

const EventLocation = () => {
    const x = 800
    const y = 300
    return (
        <>
            <div className='mx-auto w-[1000px] font-inter'>
                <div className='w-full h-[40px] text-2xl border-b-[1px] border-b-gray-200'>Location</div>
                <input placeholder='Set location' className='w-[500px] h-[50px] block outline-none bg-gray-100 rounded-[10px] p-5 mt-[20px]'/>
                <YandexMap x={x} y={y}/>
            </div>
        </>
    )
}

export default EventLocation;
